    false,nt"url": null,nt"notes": "A geospatial data set depicting the boundaries
    of marine areas designated as critical habitat under the Endangered Species Act
    (ESA) for Southern Resident killer whales. Data portray three specific areas: Area
    1 - Summer Core Area in Haro Strait and waters adjacent to the San Juan Islands;
    Area 2 - Puget Sound; and Area 3 - Strait of Juan de Fuca. The areas designated
    include all marine waters deeper than 20 feet (6.1 meters) relative to a contiguous
    shoreline delimited by the line of extreme high water. These areas occur within
    the following counties in Washington state: Clallam, Island, Jefferson, King, Kitsap,
    Mason, Pierce, San Juan, Skagit, Snohomish, Thurston, and Whatcom.",nt"license_title":
